import React, { Component } from 'react';
import { Container} from 'react-bootstrap';

class listarUsuarios extends Component {
    render() {
        return (
            <Container>
                <div flex-left ></div>
                <h1>Usuarios</h1>
            </Container>
        );
    }
}

export default listarUsuarios;
